import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AvailableDoctors from './components/AvailableDoctors';
import ScheduleAppointment from './components/ScheduleAppointment';
import DoctorAppointments from './components/DoctorAppointments';
import PatientAppointments from './components/PatientAppointments';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/schedule">Schedule Appointment</a></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" exact component={AvailableDoctors} />
          <Route path="/schedule" component={ScheduleAppointment} />
          <Route path="/doctor/:id/appointments" component={DoctorAppointments} />
          <Route path="/patient/:id/appointments" component={PatientAppointments} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
